import React from 'react'
import { Table,Form,Input,DatePicker } from 'antd'
export const ViewInventory = () => {
 const columns = [
    {
    name:"Category",
    dataIndex:"category"
    },
    {
    name:"For Machine",
    dataIndex:"for_machine"
    },
    {
    name:"Part Change",
    dataIndex:"part_change"
    },
    {
    name:"Part Name",
    dataIndex:"part_name"
    },
    {
    name:"Description",
    dataIndex:"description"
    },
    {
    name:"Cost",
    dataIndex:"cost"
    },
    {
    name:"Last Received Date",
    dataIndex:"last_received_data"
    },
    {
    name:"Stock Balance",
    dataIndex:"stock_balance"
    },
 ]
 const data = [{category:3,for_machine:2,part_name:"cutter"}]
    return (
    <div>
      <Form
        className="tool_record_form"
        name="tool-form"
        layout="inline"
        onFinish={onFinish}
        // initialValues={{
        //   price: {
        //     number: 0,
        //     currency: 'rmb',
        //   },
        // }}
      >
        <Form.Item className="tool_record_input" label="DatePicker">
          <DatePicker />
        </Form.Item>
       
        <Form.Item
          name="department"
          label="Department"
          onBlur={loadData}
          className="tool_record_input"
        >
          <Input />
        </Form.Item>
        {/* <Form.Item name="feeder" label="Feeder" className="tool_record_input">
          <Input />
        </Form.Item> */}
        <Form.Item
          name="line_number"
          label="Line Number"
          onBlur={loadData}
          className="tool_record_input"
        >
          <Input />
        </Form.Item>
        <Form.Item>
          <Button className="search_btn" htmlType="submit">
            Proceed
          </Button>
        </Form.Item>
      </Form>
        <Table
        columns={columns}
        dataSource={data}
        />
    </div>
  )
}
